import React from "react";
import { useState, useEffect } from "react";
import FileUpload from "../fileUpload/FileUpload.jsx";
import { API } from "../util/api/Api.js";
import "./crondetails.css";
let api = new API();

function CronDetails(props) {
  const [records, setRecords] = useState([]);

  useEffect(() => {
    getEntries();
    console.log("Cron Input form page reloaded");
    //eslint-disable-next-line
  }, []);

  const getEntries = () => {
    return new Promise((resolve) => {
      api
        .getRecords()
        .then((res) => {
          setRecords(res.data.message);
          console.log(Object.keys(res.data.message[0]))
        })
        .catch((err) => {
          console.log(err);
        });
    });
  };

  return (
    <div>
    <FileUpload/>
      {records.length > 0 ? (
        <div className="App">
          <table>
            <tbody>
              <tr>{
                Object.keys(records[0]).map(element=>{
                return <th>{element}</th>
              })}
              </tr>
              {records.map((val, key) => {
                return (
                  <tr key={key}>
                    <td>{val.id}</td>
                    <td>{val.name}</td>
                    <td>{val.client}</td>
                    <td>{val.env}</td>
                    <td>{val.exchange}</td>
                    <td>{val.cron}</td>
                    <td>{val.time_zone}</td>
                    <td>{val.report_cycle}</td>
                    <td>{val.created_time}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      ) : (
        ""
      )}
    </div>
  );
}

export default CronDetails;
